import React from "react";
import "./Footer.css";
import "./HorizontalneListe.css";
import HorizontalnaLista from "./HorizontalneListe";
import Ikona from "./Ikonica.js";
import "./Ikonica.css";
import "./LargeButton";
import face from "./fb.png";
import twit from "./twitter.png";
import part from "./web.png";
import LargeButton from "./LargeButton";

function Footer(props){
    const fb = {
        src: face,
        alt: "facebook"
    }
    const twitter = {
        src: twit,
        alt: "twitter"
    }
    const partners = {
        src: part,
        alt: "partners"
    }
    const fontVel = props.fontSize;
    const sirina = "100px";
    const visina = props.height;
    const iconDimensions = props.iconSize;
    return(
            <footer style={{height: visina}}>
                <div className="tekst">
                    <HorizontalnaLista 
                        prvi={<LargeButton 
                            value="ABOUT" 
                            width={sirina} 
                            height={visina} 
                            fontSize={fontVel} 
                            borderColor="#2d2d2d"
                            />}
                        drugi={<LargeButton 
                            value="TEAM" 
                            width={sirina} 
                            height={visina} 
                            fontSize={fontVel} 
                            borderColor="#2d2d2d"/>}
                        treci={<LargeButton 
                            value="CONTACT" 
                            width={sirina} 
                            height={visina} 
                            fontSize={fontVel} 
                            borderColor="#2d2d2d"/>}
                        prviLink="/about"
                        drugiLink="/team"
                        treciLink="/contact"
                    />
                </div>
                <div className="ikone">
                     <HorizontalnaLista 
                        prvi={<Ikona url={fb.src} alt={fb.alt} width={iconDimensions} height={iconDimensions}/>} 
                        drugi={<Ikona url={twitter.src} alt={twitter.alt} width={iconDimensions} height={iconDimensions}/>}
                        treci={<Ikona url={partners.src} alt={partners.alt} width={iconDimensions} height={iconDimensions}/>}
                        />
                </div>
            </footer>
    );
}

export default Footer;
